import { useState, useEffect } from "react";

const Header = () => {
  const [scrolled, setScrolled] = useState(false);
  const [isNavOpen, setIsNavOpen] = useState(false);

  const toggleNav = () => {
    setIsNavOpen(!isNavOpen);
  };

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 190) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };
    window.addEventListener("scroll", handleScroll);
    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  
  return (
    <nav
      className={`navbar navbar-expand-sm fixed-top ${
        scrolled ? "sticky" : ""
      }`}
    >
      <div className="container-fluid nav-cont">
        <div className="nav-child1">
          <a className="navbar-brand" href="/#">
            <img className="logo logo1" src="nova.svg" alt="" />
            <img className="logo logo2" src="tire.svg" alt="" />
          </a>
        </div>

        <div className="nav-child2a">
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNavDropdown"
          >
            <span className="navbar-toggler-icon"></span>
          </button>

          <div class="navbar-collapse collapse" id="navbarNavDropdown">
            <ul class="navbar-nav">
              <li class="nav-item">
                <a class="nav-link active" href="#">
                  Home
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#">
                  Vehicles
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#">
                  About
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link">Testimonials</a>
              </li>
              <li class="nav-item">
                <a class="nav-link">Contact</a>
              </li>
            </ul>
          </div>
        </div>
        <div className="nav-child2b">
          <div
            className={`hamburger-icon ${isNavOpen && "gap"}`}
            id="icon"
            onClick={toggleNav}
          >
            <div className={`icon-1 ${isNavOpen && "a"}`} id="a"></div>
            <div className={`icon-2 ${isNavOpen && "c"}`} id="b"></div>
            <div className={`icon-3 ${isNavOpen && "b"}`} id="c"></div>
          </div>

          <div id="nav" className={isNavOpen ? "show" : ""}>
            <ul className="ul">
              <li className="li li1">
                <a href="#">Home</a>
              </li>
              <li className="li li2">
                <a href="#vehicles">Vehicles</a>
              </li>
              <li className="li li3">
                <a href="#about">About</a>
              </li>
              <li className="li li4">
                <a href="#testimonials">Testimonials</a>
              </li>
              <li className="li li5">
                <a href="#contact">Contact</a>
              </li>
              <li className="li">
                <button className="sign">Sign up &gt;</button>
              </li>
            </ul>
          </div>
        </div>

        <div className="nav-child3">
          <i className="fa-regular fa-circle-user account"></i>
        </div>
      </div>
    </nav>
  );
};

export default Header;
